# Returns the result of running `fn()` and the time it took for `fn()` to run,
# in seconds. We use CUDA events and synchronization for the most accurate
# measurements.
def timed(fn):
    start = [torch.cuda.Event](https://pytorch.org/docs/stable/generated/torch.cuda.Event.html#torch.cuda.Event "torch.cuda.Event")(enable_timing=True)
    end = [torch.cuda.Event](https://pytorch.org/docs/stable/generated/torch.cuda.Event.html#torch.cuda.Event "torch.cuda.Event")(enable_timing=True)
    start.record()
    result = fn()
    end.record()
    [torch.cuda.synchronize](https://pytorch.org/docs/stable/generated/torch.cuda.synchronize.html#torch.cuda.synchronize "torch.cuda.synchronize")()
    return result, start.elapsed_time(end) / 1000

